	account_today_credit = (account_today_credit + NEW.bal_cr), 
	account_monthly_debit = (account_monthly_debit + NEW.bal_dr), 
	account_monthly_credit = (account_monthly_credit + NEW.bal_cr), 
	account_balance = NEW.bal_total 
